import React from "react";
import ReactDOM  from "react-dom";

import add,{sub,mul,div} from "./App";

ReactDOM.render(
<>
<ul>
    <li>the sum of two numbers is {add(40,4)}</li>
    <li>the subtraction of two numbers is {sub(30,3)}</li>
    <li>the multiplication of two numbers is {mul(10,3)}</li>
    <li>the division of two numbers is {div(10,3)}</li>
</ul>
</>,
document.getElementById('root')
);
